import { createSlice } from '@reduxjs/toolkit';

const initialState = {
  socket:"",
  user:"",
  valuee: ""
};

export const profileSlice = createSlice({
  name:"profile",
  initialState,
  reducers:{
    getDataUser:(state,action)=>{
      state.valuee  
    }
  }
})

export const {} = profileSlice.actions
export default profileSlice.reducer;
